import React, {useContext} from 'react';
import {Context} from './Store.js'
import Repo from './Repo.js'
import './Center.css'
import TileField from './TileField.js';

function Center() {

  const state = useContext(Context);

	return (
		<div id='center-container'>
			<div id='all-repos-container'>
				{state[0].repos.map((el, i) => <Repo repoId={i} />)}
			</div>
			<div id='middle-tiles-container'>
				{state[0].startingTile==='middle' 
				? <button id='starting-tile'>1</button> 
				: null}
				{state[0].middle.map(
					(el,i) => <TileField className={'middle-tile-button tile-color-' + i} />
				)}
			</div>
		</div>
	)
}

export default Center
